import React from "react";
import AddCart from "../component/AddCart";
import Data from "../data/store-items.json";
const cards = storeitems.map((item) => (
  <TheItem
    title={item.name}
    pic={item.image}
    price={item.price}
    _id={item._id}
  />
));
const Cart = (props) => {
  return (
    <>
      <AddCart shirtData={props.location.state} />
    </>
  );
};

export default Cart;
